import React, { useState } from "react";
import "./App.css";
import InputBox from "./InputBox";
import DisplayBox from "./DisplayBox";

function App() {
  const [ticketList, setTicketList] = useState([1, 2]);

  return (
    <div className="App">
      <h1 className="title">Ticket Entry System</h1>

      <div className="TicketEntryBody">
        <InputBox ticketList={ticketList} setTicketList={setTicketList} />
        <DisplayBox ticketList={ticketList} setTicketList={setTicketList} />
        <div className="displaybox"></div>
      </div>
    </div>
  );
}

export default App;
